  display: flex;
  justify-content: space-between;
`;

const Left = styled.div`
  flex: 1;
`;
const Language = styled.span`
  font-size: 14px;
  cursor: pointer;
`;

const Right = styled.div`
  flex: 1;
`;
const Center = styled.div`
  flex: 1;
`;

const Navbar = () => {
  return (
    <Container>
      <Wrapper>
        <Left>
          <Language>EN</Language>
        </Left>
        <Center>center</Center>
        <right>right</right>
      </Wrapper>
    </Container>
  );
};

export default Navbar;
